import React from 'react';
import PropTypes from 'prop-types';
import styles from './ProfileContent.module.css';
import RoundPicture from '../RoundPicture/RoundPicture';
import logo from '../../logo.svg';
import ProfilePic from '../../profilepic.jpg'
const ProfileContent = () => (
  <div className={styles.ProfileContent}>
    <div className={styles.ProfilePicture}>
    <RoundPicture><img height="100px" src={logo} className="App-logo" alt="logo" /></RoundPicture>
    </div>
    <div className={styles.BackGroundPicture}>

    </div>
    <div className={styles.Content}>
    <div className={styles.Section1}>
      <div className={styles.Name}>Vaibhav Gupta</div>
      <div className={styles.Desc}>Senior lover at Love World</div>
      <div className={styles.Loc}>loveland, lovePradesh, Lovecountry</div>
      <a className={styles.Connection}>10000</a>
    </div>
    <div className={styles.Section2}>
      <div className={styles.InstitutesName}>Publicis Sapient</div>
      <div className={styles.InstitutesName}>BITS Pialni</div>
    </div>
    </div>
  </div>
);

ProfileContent.propTypes = {};

ProfileContent.defaultProps = {};

export default ProfileContent;
